import styled from 'styled-components'

export const Container = styled.div`
    height: 100vh;
    width: 100vw;
`;

export const BackgroundContainer = styled.div`
    top: 0;
    left: 0;
    position: absolute;
    width: 100%;
    height: 100vh;
    display: flex;
    justify-content: center;
    align-content: center;
    z-index: 1;
`;
